        result = op(data, axis=axis, skipna=skipna, **kwds)
        if axis == 1:
            result = result.T

        if filter_type == "bool":
            result = result.astype(bool) if skipna else result.fillna(False)
        out = self._constructor_sliced(result, index=labels, dtype=bool if filter_type == "bool" else None)
        return out

